import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { useEffect, useState } from 'react';
import logo from '../src/assets/img/logo.svg';
import navIcon1 from '../src/assets/img/nav-icon1.svg';
import navIcon2 from '../src/assets/img/nav-icon2.svg';
import navIcon3 from '../src/assets/img/nav-icon3.svg';
import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import { Resume } from './Resume';

export const BasicExample=()=> {
  const [activeLink,setActiveLink]=useState('home')
  const [scrolled,setScrooled]= useState(false);

  useEffect(()=>{
    const onScrool =()=>{
      if(window.scrollY>50){
        setScrooled(true)

      }else{
        setScrooled(false);
      }
    }
    window.addEventListener("scroll",onScrool);
    return ()=> window.removeEventListener("scroll",onScrool)
  },[])
  const onUpdateActiveLink =(value)=>{
    setActiveLink(value);


  }
  return (

    <Navbar bg="blue" expand="lg" className={scrolled ? "scrolled": ""}>

      <Routes>
  <Route path="/" element={''} />
  <Route path="/resume" element={<Resume />} />
  // add more routes for other pages
</Routes>
      <Container>
        <Navbar.Brand href="#home">
          <img src={''} alt='Logo' />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <span className='navbar-toggler-icon'></span>
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home" className={activeLink ==='home' ? 'active navbar-link': 'navbar-link'} onClick={()=>onUpdateActiveLink('home')} >Home</Nav.Link>
            <Nav.Link href="#skills" className={activeLink ==='skills' ? 'active navbar-link': 'navbar-link'} onClick={()=>onUpdateActiveLink('skills')} >Skills</Nav.Link>
            <Nav.Link as={Link} to="/resume" className={activeLink === 'resume' ? 'active navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('resume')}>Resume</Nav.Link>            <Nav.Link href="#coverletter" className={activeLink ==='coverletter' ? 'active navbar-link': 'navbar-link'} onClick={()=>onUpdateActiveLink('coverletter')} >Cover Letter</Nav.Link>
            <Nav.Link href="#careergoal" className={activeLink ==='careergoal' ? 'active navbar-link': 'navbar-link'} onClick={()=>onUpdateActiveLink('careergoal')} >Career Goal</Nav.Link>
            <Nav.Link href="#cerdegrees" className={activeLink ==='cerdegrees' ? 'active navbar-link': 'navbar-link'} onClick={()=>onUpdateActiveLink('cerdegrees')} >Certificates/Degrees  </Nav.Link>
            <Nav.Link href="#workexperience" className={activeLink ==='workexperience' ? 'active navbar-link': 'navbar-link'} onClick={()=>onUpdateActiveLink('howorkexperienceme')} >Work Experience </Nav.Link>      
          </Nav>

          <span className='navbar-text'>
            <div className='social-icon'>
              <a href='https://www.linkedin.com/in/onur-korkmaz-8a928719b/'><img src={navIcon1} alt="" /></a> 
              <a href='https://www.facebook.com/lhonour/'><img src={navIcon2} alt="" /></a>
              <a href='https://www.instagram.com/ozyyyyy__/'><img src={navIcon3} alt="" /></a>

            </div>
            < button className='vvd' onClick={()=> console.log('connect')}><span>Let's Connect</span></button>
          </span>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
